<script>
    i = 0;
    $("#week_number").keypress(function(){
        i++;
        var check = $("#week_number").val();
        if (i >= 3) {
            event.preventDefault();
        }
        if (check.contains("e")) {
            event.preventDefault();
        }
    });
    document.getElementById('week_number').addEventListener('keydown', function (event) {
        var check = $("#week_number").val();
        if (check === "") {
            i = 0;
        }
        if (event.keyCode === 8) {
            if (i !== 0){
                i -= 1;
            }else {
